import React from "react";
import { navLinks, audits } from "../data";
import { lolosArrowForward } from "react-icons/io";
import { Link } from "react-router-dom";

function Home() {
  return (
    <main>
      <div className="home-recent">Recent Audits</div>
      <div className="home-unresolved">Unresolved Audits</div>
      <div className="underline"></div>
      <ul>
        {audits.filter((audit) => {
          const { tenantid, tenantName, timeRemaining, resolved, date } = audit;

          return (
            <li>
              <div>tenantName</div>
              {resolved ? (
                <div>resolved</div>
              ) : (
                <div>{timeRemaining} days left</div>
              )}
              <lolosArrowForward>
                <Link to={`/institution/${tenantid}`}>hi</Link>
              </lolosArrowForward>
            </li>
          );
        })}
      </ul>
    </main>
  );
}

export default Home;
